class UserApp extends UserApplication {

    public function getLastVersionData($userId, $datetime = '', $days = '') {
        $lastVersion = $this->getLastVersion($userId, $datetime);

        $where = [
            'user_id' => $userId,
            'version' => $lastVersion,
        ];
        $query = self::query()->where($where);
        if($days){
            $query->whereRaw("ROUND((TO_SECONDS(created_at)-TO_SECONDS(FROM_UNIXTIME(installed_time/1000)))/(3600*24))>={$days}");
        }
        $data = $query->get();

        return $data->unique('pkg_name')->toArray();
    }

    public function getLastVersion($userId, $datetime = '') {
        $query = self::query()->where('user_id', $userId);

        if ($datetime) {
            $query = $query->where("created_at", "<", $datetime);
        }

        $lastRecord = $query->latest()
                ->latest('id')
                ->first();

        if (!$lastRecord) {
            return 0;
        }

        return $lastRecord->version;
    }

    public function getMinVersion($userId) {
        $query = self::query()->where('user_id', $userId);
        $res = $query->select(DB::raw("min(version) min_version"))->get()->first();
        return $res->min_version;
    }

    public function getAppRallyCount(Order $order, $columnName = "app_name", $day = 0) {
        return count($this->getAppRally($order, $columnName, $day)->get()->toArray());
    }

    public function getAppRally(Order $order, $columnName = "app_name", $day = 0) {
        $lastVersion = $this->getLastVersion($order->user_id);
        $where = [
            'user_id' => $order->user_id,
            'version' => $lastVersion,
        ];
        $column = DB::Raw("ucase(REPLACE(`{$columnName}`, ' ','')) as '{$columnName}'");
        $query = $this->newQuery();
        $query->where($where);
        if ($day) {
            $millisecondTimestamp = strtotime(date("Y-m-d 00:00:00", strtotime("- {$day}day", strtotime($order->created_at)))) * 1000;
            $query->where("installed_time", ">=", $millisecondTimestamp)->where("installed_time", "<=", strtotime($order->created_at) * 1000);
        }
        return $query->groupby(DB::Raw("ucase(REPLACE(`{$columnName}`, ' ',''))"))->select($column);
    }

    public function getAppPack(Order $order, $version = '') {
        $columnName = 'pkg_name';
        $where = [
            'user_id' => $order->user_id
        ];
        if ($version) {
            $where['version'] = $version;
        }
        $column = DB::Raw("ucase(REPLACE(`{$columnName}`, ' ','')) as '{$columnName}'");
        $query = $this->newQuery();
        $query->where($where);
        $query->groupby(DB::Raw("ucase(REPLACE(`{$columnName}`, ' ',''))"))->select($column);
        return $query;
    }

    public function getAppNameAndPack(Order $order, $version = '') {
        $where = [
            'user_id' => $order->user_id
        ];
        if ($version) {
            $where['version'] = $version;
        }
        $column = DB::Raw("CONCAT(app_name,pkg_name) as unit_name,pkg_name,app_name");
        $query = $this->newQuery();
        return $query->where($where)->select($column);
    }

    public function getAppPackAndNameList(Order $order, $version) {
        $query = $this->getAppNameAndPack($order, $version)->get();
        $res = [];
        foreach ($query as $item) {
            $res[$item->unit_name] = [
                "pkg_name" => $item->pkg_name,
                "app_name" => $item->app_name
            ];
        }
        return $res;
    }

